import { Route, HashRouter as Router, Switch } from 'react-router-dom';

import './b_sass/main.scss';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Home from './components/Home/Home';
import Services from './components/Services/Services';
import Login from './components/Login/Login';
import Contact from './components/Contact/Contact';

// Quote Components
import Quote from './components/Quote/Quote';

import Step2 from './components/Quote/Step2/Step2';
import Step3 from './components/Quote/Step3/Step3';
import Step4 from './components/Quote/Step4/Step4';
import Step5 from './components/Quote/Step5/Step5';
import Step6 from './components/Quote/Step6/Step6';
import Step7 from './components/Quote/Step7/Step7';
import Step8 from './components/Quote/Step8/Step8';
import Step9 from './components/Quote/Step9/Step9';
import Step10 from './components/Quote/Step10/Step10';


function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Switch>
          <Route exact path={'/'} component={Home} />
          <Route exact path={'/services'} component={Services} />
          <Route exact path={'/login'} component={Login} />
          <Route path={'/quote'} component={Quote} />
          <Route exact path='/contact' component={Contact} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
